import crudIndIndicatorResult from '../../../api/indicators/indIndicatorResult'
import CRUD, { presenter, header, form, crud } from '@crud/crud'
import rrOperation from '@crud/RR.operation'
import crudOperation from '@crud/CRUD.operation'
// import udOperation from '@crud/UD.operation'
import pagination from '@crud/Pagination'
import category from '../category/category'

// crud交由presenter持有
const defaultCrud = CRUD({
  title: '指标计算结果表',
  url: crudIndIndicatorResult.url,
  sort: 'id,desc',
  crudMethod: { ...crudIndIndicatorResult.crud }
})
const defaultForm = {
  id: null,
  ieId: null,
  ieCode: null,
  ieName: null,
  ieType: null,
  ieRule: null,
  ieValue: null,
  ieAdjustValue: null,
  iePlanValue: null,
  periodDate: null,
  objectCode: null,
  objectType: null,
  status: null,
  processInstanceId: null,
  retention: null,
  crtUserCode: null,
  crtOrgCode: null,
  crtDate: null,
  updUserCode: null,
  updOrgCode: null,
  updDate: null
}
export default {
  name: 'IndIndicatorResult',
  components: { pagination, crudOperation, rrOperation, category },
  mixins: [presenter(defaultCrud), header(), form(defaultForm), crud()],
  dicts: ['RETENTION', 'IE_TYPE', 'IE_STATUS'],
  data() {
    return {
      filterText: '',
      treeData: [{
        id: 0,
        label: '指标查询',
        children: [{
          id: 0.1,
          label: '原子指标查询',
          children: [{
            id: 1.3,
            label: '存款指标'
          }, {
            id: 3,
            label: '贷款指标'
          }]
        }, {
          id: 1,
          label: '基础指标查询',
          children: [{
            id: 3,
            label: '基础指标'
          }]
        }]
      }],
      defaultProps: {
        children: 'children',
        label: 'label'
      },
      table: {
        columns: {
          id: 'hidden',
          ieId: 'hidden',
          ieRule: 'hidden',
          ieAdjustValue: 'hidden',
          iePlanValue: 'hidden',
          dimension5: 'hidden',
          dimension6: 'hidden',
          dimension7: 'hidden',
          dimension8: 'hidden',
          dimension9: 'hidden',
          retention: 'hidden',
          updUserCode: 'hidden',
          updDate: 'hidden'
        }
      },
      permission: {
        add: [''],
        edit: [''],
        del: ['']
      },
      showDialog: false
      /* rules: {
        ieId: [
          {required: true, message: '指标ID不能为空', trigger: 'blur'}
        ]
      }*/
    }
  },
  watch: {
    filterText(val) {
      this.$refs.tree.filter(val)
    }
  },
  methods: {
    filterNode(value, treeData) {
      if (!value) return true
      return treeData.label.indexOf(value) !== -1
    },
    // 获取数据前设置好接口地址
    [CRUD.HOOK.beforeRefresh]() {
      return true
    },
    viewHandle(row) {
      this.form = row
      this.showDialog = true
    }
  }
}
